import React from 'react';
import logo from '../../../assets/logo.png';
import classes from './Logo.css';
import Radium from 'radium';

const logoSpectre = (props) => {
    return (
        <div className={classes.logoAlign}>
            <img onClick={() => {props.nameSpectre('Vide'); props.closeTheme(); props.closeCategorie(); props.openSpectre();document.getElementById('margintop').style.marginTop = '644px';}} src={logo} className={classes.logo} alt="logo"/>
        </div>
    );
}

export default Radium(logoSpectre);
